import styled from "styled-components";
import { FC } from "react";
import { SingleEntity } from "./ISingleEntity";
import { IState } from "../../reducers";
import { useSelector } from "react-redux";
import { ISinglePhoto } from "../../entities/photos";
const EntitysWrapper = styled.div`
`;
const EntityMarginDiv = styled.div`
  width: 1400px;
  margin-left: 100px;
`;
const MainDiv = styled.div`
margin-left:120px;
margin-top:30px;
`;
const TopDiv = styled.div`

`;
const TitleLabel = styled.label`
float: left;
font-size:20px;
`;
const MosaicLabel = styled.div`
font-size:20px;
margin-left:1100px;
background-color:red;
`;
const IconSettings = styled.img`
position:absolute;
margin-top:5px;
margin-left:10px;
height:15px;
`;

const AllMenuDiv = styled.div`
height:30px;
width:60px;
background-color:red;
`;


export const Entity: FC = () => {
  const photosList = useSelector<IState, ISinglePhoto[]>(
    (state) => state.photos.photosList
  );

  const entity = [];
  for (let i = 0; i < 24; i++) {
    entity.push({
      name: "ABC",
      address: "Caracas 1050 Distro Capital Venezuela ",
      url: photosList[Math.floor(Math.random() * photosList.length)]?.url,
    });
  }
  return (
    <EntitysWrapper>
      <MainDiv>
          <TopDiv>
          <TitleLabel>Entities</TitleLabel>
          <IconSettings src="/media/icons/settings2.png"/>

          <MosaicLabel>Mosaic
              <img src="/media/icons/grid.png" alt="" />
          </MosaicLabel>
          </TopDiv>
          <AllMenuDiv>

          </AllMenuDiv>
    </MainDiv>'
      <EntityMarginDiv>
        {entity.map((entity) => (
          <SingleEntity
            name={entity.name}
            address={entity.address}
            url={entity.url}
            list={true}
          />
        ))}
      </EntityMarginDiv>
    </EntitysWrapper>
  );
};
